/* eslint-disable jsx-a11y/click-events-have-key-events */
/* eslint-disable jsx-a11y/anchor-is-valid */
/* eslint-disable no-underscore-dangle */
import { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';
// import { getCourse } from '../../store/service/courseService';
const URL_BASE = process.env.REACT_APP_API_URL_BASE;
console.log('url', URL_BASE);

const DetailTeacher = () => {
  const [course, setCourse] = useState();
  const { id } = useParams();
  console.log('id', id);

  // console.log('id in effe', id);
  // const fetchCourse = await axios.get(`${URL_BASE}/api/course/${id}`);
  // console.log('fetchCourse', fetchCourse);
  // setCourse(fetchCourse.data);
  // console.log('cour', course);
  useEffect(async () => {
    console.log('id in effe', id);
    const fetchCourse = await axios.get(`${URL_BASE}/api/course/${id}`);
    console.log('fetchCourse', fetchCourse.data);
    setCourse(fetchCourse.data);
    console.log('see', course);
  }, [id]);
  const see = () => {
    console.log('see', course);
  };
  return (
    <div className="flex">
      <div onClick={see}>
        <img className="chat-notification-logo" src="" alt="ChitChat Logo" />
      </div>
      <div>
        <h4>{course.title}</h4>
        <span>{course.teacher}</span>
        <p>{course.description}</p>
        <span>{course.place}</span>
      </div>
    </div>
  );
};

export default DetailTeacher;
